    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block body %}
    <form method=\"post\" class=\"login-form\">
        {% if error %}
            <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        <h1>Log in</h1>
        <input type=\"text\" value=\"{{ last_username }}\" placeholder=\"Username\" name=\"_username\" id=\"username\" class=\"form-control\" autocomplete=\"username\" required autofocus>
        <input type=\"password\" placeholder=\"Password\" name=\"_password\" id=\"password\" class=\"form-control\" autocomplete=\"current-password\" required>

        <input type=\"hidden\" name=\"_csrf_token\"
               value=\"{{ csrf_token('authenticate') }}\"
        >
        <input type=\"hidden\" name=\"_target_path\" value=\"{{path('app_login_check')}}\" />

        <button class=\"btn btn-lg btn-primary\" type=\"submit\">
            Sign in
        </button>
        <a href=\"{{path('app_register')}}\" class=\"login-switch\">Don't have account? Register.</a>
    </form>
{% endblock %}
", "login/login.html.twig", "C:\\PHP Projects\\blog\\templates\\login\\login.html.twig");
